css:
atom-dock {
  display: flex;
  position: relative;
}
.atom-dock-inner {
  display: flex;
  align-items: center;
}
.atom-dock-inner.left,
.atom-dock-inner.right {
  min-width: 1px;
}
.atom-dock-inner.bottom {
  min-height: 1px;
}
.atom-dock-inner.bottom {
  width: 100%;
}
.atom-dock-inner.left,
.atom-dock-inner.right {
  height: 100%;
}
.atom-dock-inner.bottom {
  flex-direction: column;
}
.atom-dock-inner.right {
  right: 0;
}
.atom-dock-inner.bottom {
  bottom: 0;
}
.atom-dock-inner.left {
  left: 0;
}
.atom-dock-inner.right {
  right: 0;
}
.atom-dock-inner.bottom {
  bottom: 0;
}
.atom-dock-inner.left {
  left: 0;
}
.atom-dock-inner:not(.atom-dock-open) {
  position: absolute;
  z-index: 10;
}
.atom-dock-mask {
  position: relative;
  background-color: #1d1f21;
  overflow: hidden;
  width: 100%;
  height: 100%;
  transition: none;
}
.atom-dock-mask.atom-dock-should-animate {
  transition: width 0.2s ease-out, height 0.2s ease-out;
}
.atom-dock-content-wrapper {
  position: absolute;
  display: flex;
  flex: 1;
  align-items: stretch;
  width: 100%;
  height: 100%;
}
.atom-dock-content-wrapper.right {
  left: 0;
}
.atom-dock-content-wrapper.bottom {
  top: 0;
}
.atom-dock-content-wrapper.left {
  right: 0;
}
.atom-dock-content-wrapper.left {
  flex-direction: row-reverse;
}
.atom-dock-content-wrapper.bottom {
  flex-direction: column;
}
.atom-dock-content-wrapper.right {
  flex-direction: row;
}
.atom-dock-toggle-button {
  position: absolute;
  overflow: hidden;
  z-index: 11;
  width: 50px;
  height: 50px;
}
.atom-dock-toggle-button.right {
  right: 100%;
}
.atom-dock-toggle-button.bottom {
  bottom: 100%;
}
.atom-dock-toggle-button.left {
  left: 100%;
}
.atom-dock-toggle-button.bottom {
  height: 25px;
}
.atom-dock-toggle-button.left,
.atom-dock-toggle-button.right {
  width: 25px;
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner {
  width: 50px;
  height: 50px;
  border-radius: 25px;
  position: absolute;
  display: flex;
  text-align: center;
  justify-content: center;
  align-items: center;
  cursor: pointer;
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner.right {
  left: 0;
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner.bottom {
  top: 0;
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner.left {
  right: 0;
}
.atom-dock-toggle-button:not(.atom-dock-toggle-button-visible) .atom-dock-toggle-button-inner.right {
  transform: translateX(50%);
}
.atom-dock-toggle-button:not(.atom-dock-toggle-button-visible) .atom-dock-toggle-button-inner.bottom {
  transform: translateY(50%);
}
.atom-dock-toggle-button:not(.atom-dock-toggle-button-visible) .atom-dock-toggle-button-inner.left {
  transform: translateX(-50%);
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner.right .icon {
  transform: translateX(-8px);
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner.bottom .icon {
  transform: translateY(-8px);
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner.left .icon {
  transform: translateX(8px);
}
.atom-dock-toggle-button .icon {
  transition: opacity 0.1s ease-in 0.1s;
  opacity: 1;
}
.atom-dock-toggle-button .icon::before {
  width: auto;
  margin: 0;
}
.atom-dock-toggle-button:not(.atom-dock-toggle-button-visible) .icon {
  opacity: 0;
  transition: opacity 0.2s ease-out 0s;
}
.atom-dock-toggle-button .atom-dock-toggle-button-inner {
  background-color: #1d1f21;
  border: 1px solid rgba(0, 0, 0, 0.5);
  transition: transform 0.2s ease-out 0s;
}
.atom-dock-toggle-button:not(.atom-dock-toggle-button-visible) {
  pointer-events: none;
}
.atom-dock-toggle-button:not(.atom-dock-toggle-button-visible) .atom-dock-toggle-button-inner {
  transition: transform 0.2s ease-out 0.1s;
}
.atom-dock-resize-handle {
  width: auto;
  height: auto;
  flex: 0 0 auto;
}
.atom-dock-resize-handle.atom-dock-resize-handle-resizable.left,
.atom-dock-resize-handle.atom-dock-resize-handle-resizable.right {
  cursor: col-resize;
}
.atom-dock-resize-handle.atom-dock-resize-handle-resizable.bottom {
  cursor: row-resize;
}
.atom-dock-resize-handle.left,
.atom-dock-resize-handle.right {
  width: 4px;
}
.atom-dock-resize-handle.bottom {
  height: 4px;
}
.atom-dock-cursor-overlay {
  position: fixed;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  z-index: 4;
}
.atom-dock-cursor-overlay.left,
.atom-dock-cursor-overlay.right {
  cursor: col-resize;
}
.atom-dock-cursor-overlay.bottom {
  cursor: row-resize;
}
.atom-dock-cursor-overlay:not(.atom-dock-cursor-overlay-visible) {
  display: none;
}
